import styled from "styled-components";



const Bubble = ({target,src}) => {
    const Cricle = styled.div`
width: 100px;
height: 100px;
border-radius:50%;
border: 1px solid rgb(197, 197, 197);
background-color: white;
box-shadow:0px 0px 4px grey;
font-size: ${src} ;
`
    return (
        <div>
            <Cricle />
        </div>
    );
}

export default Bubble;
